import React from 'react';
import {Link} from 'react-router-dom';
import SearchBar from './SearchBar.jsx';
import './Nav.css';


function Nav({onSearch}) {
  return (
    <nav className="navbar">
      <div className="font">
        <Link to='/'>
          <span className="navbar-brand">
            Weather App
          </span>
        </Link>
        <Link to='/about'>
          <span>About</span>
        </Link>
          <SearchBar
            onSearch={onSearch}
          />
      </div>
    </nav>
  );
};

export default Nav;
